import OctoberEventList from './eventcards/OctoberEventList';
function Events_2023_24() {
  return (
    <div>
      <h1>August</h1>
      {/* Home page content */}
      <AugustEventList />
      <h1>September</h1>
      <SeptemberEventList/>
      <h1>October</h1>
      <OctoberEventList/>

    </div>
  );
}

export default Events_2023_24;
